import React from 'react';
import './NewLift.scss';

const NewLift = props => {
  const liftList = ["SQUAT", "BENCH PRESS", "DEADLIFT"];
  return (
    <div id="new-lift">
      <form id="lift-list">
        <label>
            SQUAT
          <input type="radio" name="squat" value="squat" />
        </label>
        <input type="submit" value="ADD LIFT"/>
      </form>
      <button type="button" onClick={props.toggleModal} className="button-one">
        CANCEL
      </button>
    </div>
  );
};

export default NewLift;
